import React from 'react'
import { useSelector } from 'react-redux'
import { FavoritesList } from '../cmps/FavoritesList.jsx'

export function Home() {
    const { favorites } = useSelector(state => state.listModule)
    console.log('favorites is:', favorites);
    return (
        <section>
            <h1>Welcome Amit </h1>
            <div>
                <h2>Favorite list for you</h2>
                {favorites?.map(data => {
                    return <h1>{data.title}</h1>
                })}
            </div>
        </section>
    )
}
